INSERT INTO `tblgameposts` (`idGamePost`, `postContent`, `postGrade`, `fkidUser`, `fkidGame`) VALUES
(3, 'Je ne suis pas un expert de la série, et j\'avais bien aimé Odissey. Peut être plus pour la thématique, ou le fait de rencontrer des personnages mythiques, avoir de grandes batailles rangées et le côté coloré de la map.\r\nLes armures, armes et combos avaient un côté épique aussi!\r\nLà, perso, je trouve ça terne et mou. On n\'a pas l\'impression d\'évoluer. On peut garder la même armure tout le long, ne pas avoir à changer d\'armes. Les attaques puissantes sont moins impressionnantes, tout comme les raids sur les villages ou les prises de chateau. C\'est vide d\'ennemis, redondant, bref... c\'est pas fou.\r\nEgalement le fait de \"devoir\" vider chaque zone, pour avoir tous les trésors. C\'est long et chiant, mais nécessaire. On est pas poussé à une exploration naturelle mais juste aller d\'un point A au point B et enchainer.\r\nPerso je skip même la plupart des dialogues....\r\n\r\nDéçu...', 12, 39, 21),
(4, 'Ma note aurait été 18/20 car, comme dans tout les jeux il à des défauts j\'ai augmenté la note pour contrer les avis négatif dessus et surtout les 0/20!\r\n\r\nJe comprend vraiment pas ses gens là car ont va être honnête ce jeux là, oui ce far cry 5 c\'est une vrai turie! Que ça soit le Montana qui très réussi, le design et les graphismes *.* (question de gout),la vie qu\'il y a, mais surtout l\'immersion du jeux est juste WOW! J\'ai environ 15h de jeux et depuis le début j\'ai rester captivé et je prends énormément de plaisir à découvrir le jeux. Bien-sûr je ne suis pas un fan incontesté de far cry j\'ai jouer qu\'au 3iem opus et j\'ai pas essayé le 4 car j\'attendais un vrai bon far cry (en oubliant le primal) sur la gen actuel. Eh bien j\'ai été agréablement surpris par se far cry 5 j\'ai pris et je prend encore autant de plaisir à jouer ce jeux. Les phases de gameplay sont ultra dynamique, le level design des camps a conquérir(le jeux nous proposes énormément d\'approche a chaque camp), le jeux n\'a jamais été aussi réaliste, opresion constante quand on se balade (tu te fait constament traqué), y a de la vie partout, Y a à soucis du détail dans le jeux hallucinant (a la nauhty dog quoj). Bref vous l\'aurez compris je prends énormément de plaisir et je le recommande vivement surtout pour ceux qui sont style fps/survivaliste dans un monde ouvert hyper vaste avec plein de surprise a découvrir. Vous serez conquis!', 18, 39, 22),
(5, 'Très très grosse déception pour moi que ce FC 6. Ayant pourtant adoré les épisodes jusqu\'à Primal, et un poil déçu par le 5, j\'en attendais beaucoup de ce sixième épisode : que nenni.\r\nCe que je retiens de ce jeu en terme de qualités et de défauts :\r\n\r\nQualités :\r\n- Ambiance vraiment cool\r\n- Paysage magnifique\r\n- Gameplay toujours aussi nerveux et agréable à prendre en main\r\n- Grosse durée de vie (si on accroche un temps soit peu)\r\n- Puis c\'est tout\r\n\r\ndéfauts :\r\n- IA catastrophique, il serait temps de se pencher dessus\r\n- Autant les paysages sont somptueux, comme autant la modélisation des personnages est d\'un autre temps\r\n- Extrêmement répétitif et redondant\r\n- le scénario d\'une nullité abyssale (bon remarque un ne joue pas à un FC pour ça)\r\n- Pas de sauvegardes manuelles, sympa hein ?\r\n- L\'arbre de compétence disparait au profit d\'un système de tenu complètement bancal et inutile\r\n- Le wokisme made in Ubisoft toujours aussi présent (je joue pour me détendre, pas pour me taper de l\'idéologie politique à deux balles)\r\n- Des bugs, des bugs et encore des bugs\r\n\r\nBon bref, en résumé, si vous n\'avez jamais fait de FC pourquoi pas, les autres passez votre chemin. Cet épisode n\'en vaut pas la peine.', 10, 39, 23),
(6, 'For Honor un jeu de combat chevaleresque graphiquement nickel avec une ATH très propre.\r\nUn gameplay technique et prenant où débutant comme vétéran trouvent leur compte.\r\nAucun farming n\'est réellement nécessaire pour progresser, et la personnalisation des héros est tout à fait satisfaisante.\r\n\r\nAprès 3 ans d\'existence, voilà ce qu\'il en est :\r\n- 24 héros différents tous assez bien équilibré.\r\n- 3 modes de jeu principales, cependant seul le dominion est réellement joué et intéressant, même si les duels sont toujours fun entre amis.\r\n-Une guerre de faction qui n\'a que peu d’intérêt et qui se résume avec la victoire constante des Vikings.', 16, 39, 24),
(7, 'Je n’avais pas touché un Ghost Recon depuis GRAW2 et la découverte de celui-ci fut une heureuse surprise. D’abord circonspect par ce parachutage de licence dans un monde ouvert, la beauté et la grandeur des environnements présentés, la variété des missions, un scénario basique mais solide auront finalement su me convaincre.\r\nLa durée de vie est bonne, la customisation des armes est fun et jouer à 4 est un petit régal. Le jeu est plus grand public que les anciens opus mais on retrouve quand même un aspect tactique et infiltration qui font plaisirs et qui permettent de boucler les missions de façon assez différentes.\r\nMaintenant, pour ce qui est des défauts, comment ne pas citer la conduite des véhicules terrestres, vous les emprunterez par obligation et jamais par plaisir. Le chargement de la map vous laisse le temps de faire la sieste. Certaines armes, camouflages et autres éléments cosmétiques ne seront disponibles qu’en mettant la main à la poche.\r\nMalgré tout, ce Ghost reste hautement recommandable, surtout si vous avez la chance de pourvoir y jouer en coop.', 16, 39, 25),
(8, 'Just dance 2022 sur la PS4 avec la caméra est modéré, certes c\'est stylé de pouvoir danser sans manette mais malheureusement la caméra ne fonctionne pas correctement bien quand les gestes sont sur le corps, ce qui fait malheureusement des \"X\" alors que tu fais très bien le mouvement, c\'est dommage.\r\nLes musiques sont biens, les graphismes sont mieux donc je recommande pour le fun ', 15, 39, 26),
(9, 'Après environ 10h de jeu environ, je trouve que le jeu est vraiment excellent. Niveau du système de jeu ca ressemble beaucoup a Forza Horizon avec une très grande map en open world et des épreuves qui se déverrouillent au fil du temps dans chaque discipline. Y a beaucoup de chose a faire. On peu suivre la carrière ou s\'éclater librement sur la map remplie de park et de spot de glisse. Bien fait graphiquement, pas de beug. Bref un très bon jeu dans son genre.', 18, 39, 27),
(10, 'Un Rayman comme les autres. Rayman mini est comme les autres rayman un bon mais mais il n\'y a pas vraiment de nouveautés. J\'attends les prochains avec impatience', 15, 39, 28),
(11, 'Bien mieux que certains fps comme cod ou valorant !\r\n\r\nR6 est un réel un fps compétitif, il faut rester très attentif car on peut se faire tuer par n\'importe qui (même les alliés) n\'importe où, n\'importe quand.\r\n\r\nJ\'aime beaucoup ce genre de FPS, ça rend les parties plus stressantes et pimentées !', 20, 39, 29),
(14, 'Ce jeu est génial. Un jeu aux petits oignons, une communauté productive et une forte dose d\'addiction. Nadeo a fait un tabac avec son look simple mais montre son potentiel et le développement impressionnant du logiciel dès les premiers jeux. Le seul problème que je vois avec le jeu est la monotonie. Si l\'on n\'est pas accro au score, à la meilleure performance le jeu perd 80% des bénéfices. Étant donné que les solos ne sont utilisés que pour la pratique et que les serveurs sont utilisés par les ténors, les joueurs occasionnels courent le risque de ne pas s\'amuser à enchaîner les pertes. Les autres en revanche prendront un pied énorme.', 16, 39, 31),
(13, 'Le premier opus était un très grand jeu avec son atmosphère immersive dans un New-York dévasté, son gameplay solide et son contenu end-game. J\'attendais beaucoup de cette suite, avec un peu d\'appréhension de quitter ce jeu dans un NYC sous la neige qui restera pour moi une des meilleures direction artistique, mais je dois l\'avouer les studios d\'Ubisoft ont tenus leur promesse et TD2 mérite bien une très bonne note et que tout le monde l\'achète pour remercier le travail accompli depuis le premier.', 19, 39, 30),
(15, 'Ayant adoré le 1er opus je me suis mis donc au second. Graphiquement au top je joue en 2160p sur ps4 pro et c\'est clairement très beau bien au dessus des attentes qu\'on se ferait comparait à son prédécesseur, le gamelan très amélioré parkour. Point négatif par contre sur le personnage Marcus et l\'histoire qui pour le moment est moins abouti que celle du 1 a mon avis. Après ça reste un avis personnel mais moi j\'adorais la sorte de vendetta et le justicier Aiden Pierce, on pouvait faire peur tuer et faire s\'amuser à terroriser les ennemies contrairement avec Marcus on ou est gêné on le trouve drôle mais pas charismatique et vétéran plutôt une exagération de ses compétence de combat alors que c\'est un genre de nerd. En gros gamelan mieux graphisme mieux mais l\'histoire du jeu... Faut finir', 16, 39, 32),
(16, 'Tout simplement dans le top 3 des meilleurs Ã©pisodes de assassin\'s Creed... l\'histoire est tout simplement prenante du dÃ©but Ã  la fin... on affectionne les personnages... l\'histoire est prenante , on a tout simplement envie de passer Ã  la suite pour savoir ce qu\'il va se passer... le seul petit truc c\'est que j\'ai un Ã©cran 4K et graphiquement parfois on n\'a pas l\'impression d\'Ãªtre dans une console next gen quand on voit les gros plan , mais une fois qu on regarde l horizon et le paysage de loin alors lÃ  on dit oui... c\'est un assassin\'s Creed rÃ©ussi et on attend avec impatience la suite oÃ¹ les producteurs pourront profitez de la console next generation...', 16, 41, 21),
(17, 'Far Cry 5. Pour certains c\'est un jeu insignifiant.\r\n\r\nMais Ã§a dÃ©pend de tellement chose d\'aimer ou pas un jeu, car c\'est trÃ¨s personnel.\r\n\r\nJ\'ai vÃ©cu un truc avec ce jeu.\r\n\r\nJe me suis mis en mode RP dans un jeu pour la premiÃ¨re fois. J\'adore de base les espaces naturels amÃ©ricains. Le fait d\'Ãªtre un shÃ©rif, rendre service, faire ce qu\'on peu, comme un bon citoyen. Les musiques justes incroyables. Le beautÃ© du Montana, c\'est tellement tranquille. Joseph seed et les autres qui te pousse Ã  la rÃ©flexion. La thÃ©matique religieuse et les rÃ©fÃ©rences bibliques qui m\'ont poussÃ© Ã  mâ€™intÃ©resser Ã  la religion pour comprendre encore mieux le jeu. Je trouvais Ã§a tellement intÃ©ressent. Je pense que les gens ont beaucoup trop vite jugÃ© ce jeu et n\'ont pas vu la complexitÃ© du message. Puis mÃªme si ce n\'est pas le cas, chaque joueur Ã  sa propre expÃ©rience de jeu. Moi j\'ai la mienne.\r\n\r\nLe meilleur Far Cry ? mieux que Far Cry 3 ?. La question n\'est pas lÃ .\r\n\r\nPourquoi 17/20 ?, parce que je sais au fond de moi qu\'il ne vaut clairement pas plus. Rien d\'original dans son gameplay et dans les mÃ©caniques de jeu. Mais mÃªme mon expÃ©rience fausse ma note.\r\n\r\nÃ‡a restera une des meilleures expÃ©riences de jeu que j\'ai pu vivre.\r\n\r\nUn de mes jeux favoris.', 17, 41, 22),
(18, 'Un peu de mal a entrer dans l\'histoire, j\'ai maintenant 30h de jeu et j\'aime de plus en plus.\r\nUn bon Far Cry en somme, la seule chose qui me manque c\'est le skill tree remplacÃ© par les bonus de stuff.\r\nAmbiance sonore trÃ¨s soignÃ©e qui colle trÃ¨s bien au contexte.\r\nPour la partie graphique c\'est du lourd chez moi, ma 3070 fait le taf et le jeu est superbe sans aucun ralentissement en full ultra / QHD\r\nUn trÃ¨s bon divertissement, j\'avoue que j\'ai du mal avec ce bashing anti Ubi en permanence. Si vous n\'aimez pas ce qu\'ils font, passez Ã  autre chose au lieu de cracher votre venin sans arret.', 16, 41, 23),
(19, 'L\'idÃ©e sur le thÃ¨me mÃ©diÃ©val ma beaucoup plus les guerriers sont super badass l\'imerssion est juste magnifique les architectures de chaque peuples sont trÃ¨s fantastiques ce qui les rend trÃ¨s belle parcontre les guerriers sont historiquement exagÃ©rÃ© mais ce qui fait le charme du jeux. Le jeux est trÃ¨s beaux graphiquement sur chaque plateforme. :)', 17, 41, 24),
(20, 'Ubisoft signe en ce dÃ©but d\'annÃ©e un trÃ¨s grand jeu, pour donner mon avis j\'ai attendu d\'atteindre au moins 10h de jeu. Gameplay, sensation, contexte, scÃ©nario, tout est lÃ . Je mets 18 et non 20 Ã  cause des graphismes qui sont lÃ©gÃ¨rement faibles pour un jeu de ce calibre, mÃªme si cela reste trÃ¨s trÃ¨s respectable. En rÃ©sumÃ©, foncez les yeux fermÃ©s, Ghost Recon est de retour au sommet!', 18, 41, 25),
(21, 'Ubisoft, ne trouvez-vous pas que la licence tourne un poil en rond depuis quelques annÃ©es ? Ne vous Ã©tonnez pas si Just Dance 2023 est un tel Ã©chec commercial : vous avez tout mis en Å“uvre pour qu\'il n\'ait pas la moindre chance.\r\n\r\nCe quatorziÃ¨me opus de la sÃ©rie n\'apporte strictement rien de nouveau. Pire encore : il enlÃ¨ve du contenu ! D\'ailleurs, en parlant de disparition, oÃ¹ est ma cartouche monsieur Guillemot ? Pourquoi uniquement proposer un code de tÃ©lÃ©chargement ? Tous vos titres n\'ont pas Ã  Ãªtre des jeux-services, surtout lorsqu\'on les paye si cher.', 7, 41, 26),
(22, 'AprÃ¨s avoir &quot;fini&quot; le jeu et cumulÃ© 1000 Ã©toiles, je pense avoir un avis assez prÃ©cis sur le jeu.\r\nSans Ãªtre exempt de dÃ©fauts (mineurs, la plupart du temps), le jeu propose un Ã©ventail de sport assez large pour satisfaire les indÃ©cis, sans pour autant les nÃ©gliger. J\'ai personnellement une prÃ©fÃ©rence pour le vÃ©lo et le ski par exemple, mais je prend tout de mÃªme du plaisir sur du wingsuit grÃ¢ce Ã  une map trÃ¨s travaillÃ©, et que ce soit en exploration ou en Ã©preuve, on prend du plaisir Ã  la dÃ©couvrir. Inclure une vue la premiÃ¨re personne est une excellente idÃ©e, j\'ai des vertiges quand j\'attaque une pente en vÃ©lo, c\'est plutÃ´t dingue comme sensation. Je n\'avais rencontrÃ© aucun bug majeur sur la bÃ©ta, et il y en a encore moins sur le jeu final. Probablement un must have en cette fin d\'annÃ©e pour le jeu d\'ubisoft qui coche toutes les cases (gameplay/direction artistique/bande son/ et un cotÃ© moitiÃ© arcade moitiÃ© rÃ©aliste qui pourra satisfaire tout le monde).\r\nPour moi, le jeu efface les erreurs de Steep, injecte une dose de fun et j\'espÃ¨re que les prochains sports seront Ã  la hauteur des sports dÃ©jÃ  prÃ©sent !', 18, 41, 27),
(23, 'Ce jeux nâ€™est malheureusement pas une rÃ©volution des jeux Rayman sur mobile mais est plutÃ´t une rÃ©volution au niveau des graphismes...\r\nCâ€™est un rayman fiesta run remasterisÃ© dans un autre environnement...', 12, 41, 28),
(24, 'Beaucoup de bug mais trÃ¨s prenant et stratÃ©gique , un TTK rapide , sa me rappelle mes belle annÃ©es sur R6 vegas mais en fps . Ne pas se dÃ©courager au dÃ©but et bien faire les tutos de situation afin de ne pas Ãªtre perdu et gagner de la free renommÃ© .', 16, 41, 29),
(25, 'Pour toutes les personnes qui disent que c\'est du td1.5, je vous conseille fortement de le tester, vous verrez que le changement est radical.\r\nGraphiquement c\'est une claque sur pc,Ã§a grouille de dÃ©tails.\r\nLe cycle jour nuit, la mÃ©tÃ©o qui change et je rajouterais a cela une sonorisation(les bruits autour,le son des armes,....) aux petits oignons.\r\nBref, trÃ¨s bon jeu que je ne peux que vous conseiller.', 18, 41, 30),
(26, 'Etant un gros joueur de Trackmania Ã  la belle Ã©poque, je trouve Ã§a incroyable comment Nadeo arrive Ã  suicider ses jeux, alors qu\'ils ont tout pour rÃ©ussir.\r\n\r\nPremiÃ¨re erreur, le modÃ¨le Ã©conomique, mÃ©langer une partie F2P et l\'autre payante, trÃ¨s bien aucun problÃ¨me, bonne idÃ©e. Sauf qu\'il aurait fallu le faire avec 2 parties ! LÃ  3 Ã©ditions c\'est totalement illisible, et leurs tableaux comparatifs sont illisibles. Et enlever le multi de la partie F2P c\'est du non sens.\r\nIls auraient du faire une version F2P avec le online, quelques courses au solo, et une payante avec les skins, l\'Ã©diteur, le solo complet... Ã§a aurait 10x plus logique et lisible\r\n\r\nEnsuite l\'ergonomie, avant c\'Ã©tait simple, un menu avec boutons, avec une liste de serveur, maintenant tout est mÃ©langÃ©, on comprends rien, il y en a partout c\'est un fouillis sans nom.\r\nEn jeu c\'est pas mieux, la camÃ©ra 3 est impraticable, les nouveaux blocs &quot;bonus&quot; sont pas facilement identifiable sur la route. La nouvelle fonctionnalitÃ© de pas perdre sa vitesse au checkpoint est sympa, mais ils ont mÃªme pas pensÃ© qu\'on puisse ne pas avoir envie de toujours garder sa vitesse si Ã§a trajectoire est naze, du coup c\'est plus inutile qu\'autre chose\r\n\r\nGraphiquement, le jeu est tristoune, moins de dÃ©co, tout est fade et trop Ã©purÃ© (et pas Ã©purÃ© style chic et lisible, mais plutÃ´t Ã©purÃ© cheapos). En terme d\'options leur anti-aliasing rend le jeu flou (surement un TAA mal foutu), et on a toujours droit Ã  un jeu Ã  moitiÃ© freezÃ© pendant les chargements. Chargement un peu long d\'ailleurs. J\'ai une suggestion : Pourquoi ne pas telecharger/charger la map suivante quand on joue ?\r\n\r\nBref, pour l\'instant, on a l\'impression d\'avoir un jeu pas terminÃ© avec des choix de design et marketing douteux. Alors que c\'est un jeu qui est peut Ãªtre vraiment fÃ©dÃ©rateur, tellement c\'est simple Ã  comprendre et basique (et c\'est Ã§a qui est bon)', 12, 41, 31),
(27, 'Je pense que beaucoup de personnes ne sont pas honnetes avec eux meme. Oui, le jeu ressemble Ã  une pale copie de Gta. Et alors? Arriver au niveau de Rockstar dans ce style de jeu mets de nombreuses annÃ©es.\r\nAyant Ã©tÃ© le premier Ã  cracher sur WD1, ce WD2 est carrÃ©ment supÃ©rieur et on vois une nette Ã©volution dans le gameplay, le scÃ©nario, et les interactions.\r\nApres, bcp de chemin restent Ã  parcourir mais donner des notes infÃ©rieur Ã  12, c\'est etre malhonnÃªte avec sois mÃªme...', 15, 41, 32),
(28, 'ok', 2, 39, 21),
(29, 'Just dance 2022 sur la PS4 avec la caméra est modéré, certes c\'est stylé de pouvoir danser sans manette mais malheureusement la caméra ne fonctionne pas correctement bien quand les gestes sont sur le corps, ce qui fait malheureusement des \"X\" alors que tu fais très bien le mouvement, c\'est dommage.\r\nLes musiques sont biens, les graphismes sont mieux donc je recommande pour le fun ', 15, 39, 26);

