--
-- Structure de la table `tblgames`
--

DROP TABLE IF EXISTS `tblgames`;
CREATE TABLE IF NOT EXISTS `tblgames` (
  `idGame` int(11) NOT NULL AUTO_INCREMENT,
  `gameName` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `gameDescription` longtext COLLATE utf8_unicode_ci NOT NULL,
  `gameGenre` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `gameAvis` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `gameClassification` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `gameMode` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `gameImg` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `gameTrailer` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `gameImgOther` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`idGame`)
) ENGINE=InnoDB AUTO_INCREMENT=33 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

--
-- Déchargement des données de la table `tblgames`
--

INSERT INTO `tblgames` (`idGame`, `gameName`, `gameDescription`, `gameGenre`, `gameAvis`, `gameClassification`, `gameMode`, `gameImg`, `gameTrailer`, `gameImgOther`) VALUES
(21, 'Assassin\'s Creed : Valhalla', 'Les frères Eivor et Sigurd sont à la tête de leur intrépide groupe de Vikings et vous jouez le rôle d\'Eivor, qui peut être un homme ou une femme, selon votre choix. Mais ne vous préoccupez pas de votre sexe, car vous pourrez y revenir à tout moment, même dans le tumulte de la bataille si vous avez soudainement besoin d\'un changement.\r\n\r\nSi le champ de bataille n\'est pas votre truc, il y a tellement d’autres choses à découvrir dans ce jeu. Visitez l\'écurie pour acheter des chevaux, faites un saut dans la cabane de pêche avant de vous rendre au bord des ruisseaux et des lacs, et gardez votre équipement à jour dans votre hutte de chasse. Il y a même une volière où il vous est possible de personnaliser vos corbeaux en leur attribuant par exemple des éclairs blancs sur leurs ailes. En prime, vos prises de pêche et à la chasse peuvent être échangées contre diverses récompenses ou contre de la monnaie. En tant que Viking, vous souhaitez bien sûr conserver votre accès à la mer et il existe un chantier naval où vous pouvez réparer, entretenir, construire et remplacer votre chaloupe.\r\n\r\nAu début, vous serez chargé d’acquérir des compétences et de fabriquer de nouveaux objets, même si vous plantez et cultivez des plantes, vous participerez à des batailles quand les pilleurs tenteront de vous prendre ce que vous avez. La création d\'une boulangerie, d\'une ferme d\'élevage et d\'une brasserie vous permettra de vous nourrir, vous et votre clan, tandis que Gunnar, le forgeron, vous fabriquera des armes assez impressionnantes !\r\n\r\nLe cartographe vaut le détour, car il peut vous offrir de temps en temps des cartes spéciales qui peuvent vous indiquer des itinéraires de raid très rentables - cela vaut bien l\'investissement que représente une petite amitié et quelques pièces d\'or.\r\n\r\nLorsque vous décidez de partir en mission, vous avez la possibilité de choisir les guerriers parmi une sélection, qui vous accompagneront et tous peuvent être légèrement personnalisées afin que vous disposiez d’une équipe soudée. Mais il n\'y a pas que des combats - vous pouvez assister à des mariages de membres d\'une tribu, boire beaucoup et vous retrouver avec une terrible et bien méritée gueule de bois après des combats de rap que votre personnage sera très heureux de consigner aux oubliettes !', 'Aventure | Action | Open World | Roguelike', '18', '18', 'Jouable en solo', 'IMG-6277a0b2c5b848.96970598.png', 'https://www.youtube.com/embed/DiqaG1TWdgM', 'IMG-6277a0b2c60264.74180432.jpg'),
(22, 'Far Cry 5', 'Vous prenez le rôle de l\'adjoint d\'un shérif débutant, accompagnant vos collègues pour procéder à une arrestation. Votre mission est d\'arrêter un chef de secte nommé Joseph Seed qui a la mauvaise habitude de kidnapper les gens pour les forcer à rejoindre son culte apocalyptique.\r\n\r\nL\'arrestation prévue, une mission conjointe entre le shérif, ses hommes et les US Marshals, va mal tourner et Joseph Seed et son culte se dispersent dans la brousse, jurant que ceux qui s\'en sont mêlés soient punis. Un accident d\'hélicoptère tue certains de vos collègues, vous laissant à la recherche des membres de la secte et de Seed Down.\r\n\r\nLa tentative d\'arrestation conduit Seed à commencer sa partie finale, lui et ses partisans croyant que la fin du monde est proche sont prêts à tuer tout le monde dans le comté afin de \"sauver\" leur âme pour l\'éternité : c\'est votre mission de les traquer pour minimiser le nombre de morts.\r\n\r\nIl s\'agit d\'un format Open World, ce qui signifie que vous pouvez explorer librement la carte, en recueillant des objets qui pourraient vous être utiles en cours de route - il peut s\'agir de gros billets comme des avions et des hélicoptères, ainsi que de la nourriture, des armes et des kits de survie.', 'Infiltration | Action | FPS', '14', '18', 'Jouable en solo | Multi en ligne', 'IMG-634fc658e8f505.99867825.jpg', 'https://www.youtube.com/embed/dMdLoVt235Y', 'IMG-6277c1dd824bc4.76072935.jpg'),
(23, 'Far Cry 6', 'Dans ce lieu d\'une beauté époustouflante, à l\'architecture superbe, bien qu\'ancienne, le dictateur maléfique, Anton Castillo (superbement interprété par Giancarlo Esposito) a une leçon à donner à son fils. Il lui tend une grenade, appuie sur le mécanisme de mise à feu et retire la goupille. C\'est ainsi, explique-t-il, que sont les gens : obéissants tant qu\'ils sont sous une emprise ferme. Mais si vous êtes trop détendu avec eux, ... Boom, vraisemblablement.\r\n\r\nCette leçon est une façon pour El Presidente d\'essayer d\'endurcir son fils, de le préparer à succéder à son régime brutal. Il est rafraîchissant de constater qu\'il n\'est pas montré comme un méchant en noir et blanc : il a ses raisons pour justifier son comportement qui sont, pour lui au moins, sensées. Le fait que le peuple ait besoin d\'une emprise ferme pour que les choses ne deviennent pas bruyantes, sanglantes et quelque peu éphémères - pour les Castillos en tout cas ! - est étayé par l\'existence de la résistance. C\'est là que vous intervenez.\r\n\r\nVous êtes un rebelle, un résistant du nom de Dani Rojas (vous pouvez choisir votre sexe au début du jeu : le Dani masculin est interprété par Sean Rey, et le féminin par Nisa Gunduz). Vous pouvez fabriquer vos propres armes si nécessaire, et engager des compagnons (canins) pour vous aider dans vos actions. L\'un d\'entre eux est Chorizo, un adorable teckel dans un fauteuil roulant canin, alors ne vous décidez pas trop vite à faire cavalier seul : le côté mignon est presque irrésistible !\r\n\r\nLes graphismes magnifiquement détaillés ressemblent presque à des séquences vidéo stylées - encore plus beaux que la réalité, tout en étant très réalistes ! Vous pouvez jouer avec votre groupe réel dans le mode multijoueur coopératif qui fait son retour dans cette édition.', 'Open World | FPS', '16', '18', 'Jouable en solo | Multi en ligne', 'IMG-6277c1dd81fac1.30807447.png', 'https://www.youtube.com/embed/hliXO-ZNhIY', 'IMG-6277c1dd824bc4.76072935.jpg'),
(24, 'For Honor', 'Vivez l’intensité et le chaos du champ de bataille dans For Honor.\r\n\r\nChoisissez votre guerrier parmi un large panel d\'intrépides Chevaliers, de Vikings sanguinaires et de redoutables Samouraïs, avec pour chacun des armes, un style de jeu et des choix de personnalisation bien différents.\r\n\r\nLivrez des batailles et des sièges spectaculaires. Affrontez des boss dans d\'intenses duels pour protéger votre clan face à un ennemi imprévisible.\r\n\r\n\r\nFor Honor propose une intense compagne solo et un multijoueur haletant.\r\n\r\n\r\nManiez de lourdes armes avec un sentiment de puissance extraordinaire, grâce à ce système qui vous donne un contrôle total.\r\n\r\nIntensifiez l\'expérience du jeu d\'action avec Tobii Eye Tracking. Plongez votre regard dans le jeu pendant que vos yeux dirigent l\'écran en élargissant votre vision dans les champs de bataille.\r\nCompatible avec tous les systèmes eye tracking de la série \"Gaming\" de Tobii, dédiée aux jeux vidéo.', 'Action', '15', '18', 'Jouable en solo | Multi en ligne | Multi en coopératif | Multi en compétitif', 'IMG-634d764b7150e7.77061213.jpg', 'https://www.youtube.com/embed/T_23XmPTfRo', 'IMG-634d75c243ae64.57433881.jpg'),
(25, 'Tom Clancy\'s Ghost Recon : Wildlands', 'Ghost Recon: Wildlands dispose de l’une des plus grandes map jamais vue, donnant au joueur un monde gigantesque à explorer.\r\n\r\nSur la version beta, il n’y avait qu’une province sur laquelle les joueurs pouvaient tester le jeu, la version finale dispose d’un nombre impressionnant de 20 provinces, chacune est indépendante et offre des challenges qui nécessitent l’apprentissage et l’utilisation de nouvelles compétences, de différents modes de voyages, de raids dans des bases fortifiées du cartel, et des interrogatoires et tant d’autres choses.\r\n\r\nSur chaque province il y a au moins un boss du Cartel de Santa Blanca pour vous challenger encore plus. Vous pouvez explorez la map entière dès le début, et les graphismes de la Bolivie par Ubisoft rendent superbement bien, vous offrant un aperçu des grottes,de la jungle vous faisant aussi découvrir les déserts, les salines, les montagnes, les marais, les lacs et les carrières.', 'TPS | Infiltration', '17', '18', 'Jouable en solo | Multi en local | Multi en ligne | Multi en coopératif | Multi en compétitif', 'IMG-6352a39cf05449.12183155.jpg', 'https://www.youtube.com/embed/kJMWzIUPqhk', 'IMG-6352a39cf09d87.45088050.jpg'),
(26, 'Just Dance 2022', 'Just Dance 2022, le jeu de danse par excellence, est de retour avec des univers inédits et 40 nouveaux morceaux issus de tubes à succès comme \"Believer\" de Imagine Dragons, \"Level Up\" de Ciara, et bien plus encore !\r\n\r\nVous êtes à la recherche du jeu idéal pour danser sur les hits du moment et vous amuser avec vos amis et votre famille ? Just Dance 2022 est fait pour vous !\r\n\r\nFaites de l\'exercice tout en vous amusant et commencez votre propre routine avec le mode Sweat. Restez motivé, suivez les calories que vous brûlez et le temps que vous passez à danser.\r\nFaites équipe avec vos amis et envahissez la piste de danse en mode Co-op.\r\n\r\nRejoignez une communauté de plus de 138 millions de joueurs à travers le monde et prenez la vie du côté Just Dance !\r\n\r\nCe jeu utilise Smart Delivery pour vous donner accès à la fois au titre Xbox One et au titre Xbox Series X|S', 'Danse ', '15', '12', 'Jouable en solo | Multi en ligne', 'IMG-6277cbba06bf30.27950667.jpg', 'https://www.youtube.com/embed/ielBKEQ3p9U', 'IMG-6277cbba070b55.21555159.png'),
(27, 'Riders Republic', 'Découvrez l\'immense terrain de jeu multijoueur de Riders Republic ! Avec votre vélo, vos skis, votre snowboard ou votre wingsuit, explorez un paradis sportif en monde ouvert où vous imposez vos règles.\r\n\r\nAffrontez plus de 50 joueurs simultanément dans un immense terrain de jeu multijoueur.\r\nParticipez à des courses Mass Start extrêmes. Battez-vous et frayez-vous un chemin jusqu\'à la ligne d\'arrivée !\r\nPersonnalisez votre personnage pour afficher votre style devant vos amis ou frimer dans les compétitions.\r\nAvec votre vélo, vos skis, votre snowboard ou votre wingsuit, parcourez un monde ouvert unique en mode Carrière ou dans des événements multijoueur.\r\nDéchaînez-vous dans les célèbres parcs nationaux américains comme Yosemite, Zion et Bryce Canyon.', 'Compilation | Sport', '14', '3', 'Multi en ligne | Multi en compétitif', 'IMG-627c1d61578b82.37357556.jpg', 'https://www.youtube.com/embed/cP3a45jqTqo', 'IMG-627c1d6157dad5.88750114.jpg'),
(28, 'Rayman Mini', 'Rayman a été réduit à une taille microscopique. Les insectes, les champignons, les feuilles et autres plantes seront vos alliés pour naviguer dans cet univers macro photographique magique et merveilleux.\r\n\r\nDe rivières en troncs d’arbres sans oublier les envahissantes toiles d’araignées, Rayman mini emmène les joueurs à travers 48 niveaux époustouflants d’un monde riche et naturel.\r\n\r\nRayman Mini est un jeu de plateforme pour toute la famille. Il propose une expérience très enlevée qui permet aux joueurs de choisir leur rythme de jeu. Lancez un run simple de quelques secondes, ou relevez le défi d\'atteindre le score parfait.\r\n\r\nPour tirer votre épingle du jeu dans ce monde XXL il faudra trouver le timing adéquat pour décrocher le run idéal. Aiguisez vos réflexes, mémorisez les cartes et rejouez les niveaux autant de fois que vous voudrez … et qui sait, vous trouverez peut-être des trésors cachés !\r\n\r\nChoisissez un des 3 personnages et débloquez de nombreux costumes pour personnaliser votre partie.\r\n\r\nC’est le début de votre voyage dans l’univers Rayman Mini… Restez connecté pour plus de fun (miniature) !', 'Runner | Plate-Forme', '16', '3', 'Jouable en solo', 'IMG-634fc2bd054a67.66216490.png', 'https://www.youtube.com/embed/wDa4LbcN4d4', 'IMG-634fc1d4bcb9b0.40113215.png'),
(29, 'Tom Clancy\'s Rainbow Six Siege', 'Le joueur choisit de jouer comme l\'un des membres des équipes Rainbow. Il y en a plusieurs au choix, et chaque personnage a des équipements et des gadgets différents, des armes spécialisées et sont même de nationalités différentes. Vous pouvez jouer en tant qu\'agents américains, allemands, russes, français ou britanniques, le tout en équipes de quatre.\r\n\r\nLes joueurs peuvent choisir leur personnage, faire des mises à jour et personnaliser les armes et les gadgets, ainsi que choisir les points de réapparition : mais une fois la mission lancée, ces choix ne peuvent être annulés et les joueurs doivent considérer soigneusement toutes ces informations avant de prendre un engagement quelconque.\r\n\r\nUne fois qu\'une bataille est lancée, elle doit se poursuivre jusqu\'à la fin, et les joueurs ne peuvent pas la rejouer tant qu\'elle n\'est pas perdue ou gagnée. Les personnages tués dans la mêlée, cependant, peuvent entrer en mode Support, et aider leurs compagnons à distance comme support radio ou équivalent.', 'Action | FPS | Tactique | Shooter', '19', '18', 'Jouable en solo | Multi en ligne | Multi en coopératif', 'IMG-6277c4d6a07249.43984088.png', 'https://www.youtube.com/embed/CSB_LTDL5eU', 'IMG-6277c4d6a0cbc4.07722543.jpg'),
(30, 'Tom Clancy\'s The Division 2', 'La suite reprend l\'histoire quelque sept mois plus tard alors l\'action s\'est déplacée à Washington. Washington a été évacué de tous les représentants du gouvernement et Air Force One s\'est écrasé près du Capitole - des informations qui sont visuellement dépeintes avec des détails époustouflants - et les rebelles ont envahi la ville. La Division est chargée de nettoyer la ville et de rassembler tous les objets de valeur qui pourraient se trouver à proximité.\r\n\r\nIl y a une multitude de quêtes parallèles et de défis à relever pour maintenir votre intérêt tout au long du jeu, y compris l\'exploration de l\'Air Force One tombé au combat et l’enquête relative à la disparition du Président que l’on soupçonne d’avoir été tué en dehors d’un combat armé.\r\n\r\nLe corps de l\'avion contient une mine de trésors, alors assurez-vous de l\'explorer à fond, mais surtout surveillez les agents privés de leurs droits qui sont devenus malhonnêtes, les miliciens ennemis et quiconque qui pourrait être en position pour voler votre butin et gâcher votre mission.', 'Action | TPS | MMO', '15', '18', 'Jouable en solo | Multi en ligne', 'IMG-6277c6a22b28e2.44535644.jpg', 'https://www.youtube.com/embed/Y08cTv1JDIA', 'IMG-6277c6a22b6de6.00832467.jpg'),
(31, 'Trackmania', 'Un jeu de course décoiffant: Démarrez le bolide et embarquez-vous pour une course folle où seuls vos talents de pilote feront la différence !\r\n\r\nEntraînez-vous dans une campagne solo regroupant plus de 65 courses avant de vous mesurer aux joueurs du monde entier en multi Un mode multijoueurs délirant avec plus de 100 voitures sur un même circuit en simultané.\r\n\r\nGrâce à son gameplay pur, TrackMania² Stadium est très facile à prendre en main, mais seuls les meilleurs pilotes arriveront en haut du podium\r\nUn Stade de Légende: Plébiscité par des millions de pilotes dans le monde entier, l’environnement Stadium est de retour et meilleur que jamais, avec des possibilités décuplées par ManiaPlanet !\r\n\r\nManiaPlanet fournit tous les outils pour créer et partager vos créations avec la communauté TrackMania. Que vous souhaitiez produire des vidéos, des circuits personnalisés, des skins de voiture ou encore des modes de jeu complets: vous trouverez ici tout ce dont vous aurez besoin.\r\n\r\nTrackMania Stadium a connu un grand succès sur la scène eSports depuis des années, et est maintenant de retour avec encore plus de possibilités grâce aux nouveaux outils de gestion des équipes et tournois, l’intégration du livestream, et bien d’autres nouveautés !', 'Course', '17', '8', 'Jouable en solo | Multi en ligne', 'IMG-627c1d61578b82.37357550.jpg', 'https://www.youtube.com/embed/BxublGcdCb4', 'IMG-6277cd24928972.77357145.jpg'),
(32, 'Watch Dogs 2', 'Vous incarnez Marcus Holloway, un rebelle qui tente de déjouer les tentatives des autorités de la ville pour contrôler la population à l\'aide d\'équipements de surveillance de haute technologie. Marcus Holloway est membre d\'un gang de hacktivistes, l\'un de leurs meilleurs membres, et c\'est son travail de mener à bien des missions, d\'amener des partisans au gang, connu sous le nom de DedSec.\r\n\r\nLes concepteurs du jeu ont voulu incorporer au jeu un brouillage des frontières entre la réalité et la fiction, et ont consulté de vrais hacktivistes, ont semi-fictionnalisé des hacks informatiques réels, et ont consacré de longues heures à rendre l’univers du jeu authentique pour les joueurs - et c\'est très réussi !\r\n\r\nMarcus doit voyager dans une région bien définie, c’est une version fictive de la Baie de San Francisco, en utilisant n\'importe lequel des véhicules qui se trouve sur son chemin. Il croise notamment des motos, des fourgonnettes, des voitures, des camions, des quads et même des bateaux. Il a une excellente maniabilité et peut même surmonter des objets et grimper aux murs en se déplaçant à pied.', 'Aventure | Infiltration | Action', '17', '18', 'Jouable en solo', 'IMG-6277c834d664b1.00746124.jpg', 'https://www.youtube.com/embed/_CJHiMnGHSI', 'IMG-6277c834d6a5d1.31294186.jpg');

