(26, 'PS4 | XBOX | SWITCH', '04/11/2021', 25, 15, 'Payant à l\'acquisition', 'Just Dance 2022', 'Le nouvel opus de la licence rythmée d Ubisoft propose pas moins de 40 nouveaux titres, parmi lesquels on retrouve notamment, Todrick Hall, avec son nouveau titre Nails, Hair, Hips, Heels, Imagine Dragons ou encore Ciara.', 'Danse ', '15', '12', 'Jouable en solo | Multi en ligne', 'AppJeuConsole', 'AppJeuConsole', 'AppJeuConsole'),
(27, 'PS4 | XBOX', '12/05/2014', 9, 13, 'Payant à l\'acquisition', 'Riders Republic', 'Nouveau jeu du studio du jeu de sports extrêmes Steep, Riders Republic nous embarque dans un univers déjanté où les biens nommés Riders règnent en maître.', 'Compilation | Sport', '14', '3', 'Multi en ligne | Multi en compétitif', 'AppJeuConsole', 'AppJeuConsole', 'AppJeuConsole'),
