(21, '10/11/2020', 'Payant à l\'acquisition', 40, 'Windows', 'Ryzen 3 1200 - 3.1 Ghz | Core i5-4460 - 3.2 Ghz', 'AMD Radeon R9 380 | NVIDIA GeForce GTX 960', 34, 'Assassin s Creed : Valhalla', 'Assassins Creed Valhalla est un RPG en monde ouvert se déroulant pendant l âge des vikings. Vous incarnez Eivor, un viking du sexe de votre choix qui a quitté la Norvège pour trouver la fortune et la gloire en Angleterre.', 'Open World | Action RPG | Infiltration', '18', '18', 'Jouable en solo', 'AppJeuPc', 'AppJeuPc', 'AppJeuPc'),
(22, '27/03/2018', 'Payant à l\'acquisition', 35, 'Windows', 'Intel Core i5-2400 | AMD FX-6300 @ 3.5 GHz', ' NVIDIA GeForce GTX 670 | AMD R9 270', 23, 'Far Cry 5', 'Far Cry 5 est un jeu d action / aventure jouable en solo. Bienvenue Ã  Hope County dans le Montana, terre de libertÃ© et de bravoure qui abrite un culte fanatique prÃªchant la fin du monde : Edenâ€™s Gate.', 'Infiltration | Action | FPS', '14', '18', 'Jouable en solo | Multi en ligne', 'AppJeuPc', 'AppJeuPc', 'AppJeuPc'),
(23, '07/10/2021', 'Payant à l\'acquisition', 48, 'Windows | Linux', 'AMD Ryzen 3 1200 3.1GHz | Intel Core i5-4460 3.2GHz', 'AMD Radeon RX 460 4GB | Nvidia GeForce GTX 960 4GB', 37, 'Far Cry 6', 'Far Cry 6 est un FPS qui se déroule sur l île tropicale fictive de Yara. Vous incarnez Dani Rojas, un membre de la guérilla locale qui lutte contre le régime oppressif du dictateur du pays.', 'Open World | FPS', '16', '18', 'Jouable en solo | Multi en ligne', 'AppJeuPc', 'AppJeuPc', 'AppJeuPc'),
(29, '01/12/2015', 'Payant à l\'acquisition', 40, 'Windows', 'Intel Core i3 560 @ 3.3GHz | AMD Phenom II X4 945 @ 3.0Ghz', 'NVIDIA GeForce GTX 460 | AMD Radeon HD 5770', 35, 'Tom Clancy\'s Rainbow Six Siege', 'Tom Clancys Rainbow Six Siege est un jeu d action tactique appartenant à la fameuse série du même nom. Cet épisode est principalement axé sur le multijoueur et l importance du jeu en équipe, avec des environnements facilement destructibles.', 'Action | FPS | Tactique | Shooter', '19', '18', 'Jouable en solo | Multi en ligne | Multi en coopératif', 'AppJeuPc', 'AppJeuPc', 'AppJeuPc'),
(30, '15/03/2019', 'Payant à l\'acquisition', 20, 'Windows', 'AMD FX 6350 | Intel Core i5-2500K', 'AMD Radeon R9 280X 3GB | NVIDIA GeForce GTX 780', 42, 'Tom Clancy\'s The Division 2', 'Tom Clancy\'s The Division est un jeu d action en ligne où le joueur est au cœur d un univers post-apocalyptique. Ce dernier doit jongler entre coopération, stratégie et technologie pour survivre dans un environnement hostile. Partez en compagnie de la Division pour sauver Washington D.C. de l effondrement.', 'Action | TPS | MMO', '15', '18', 'Jouable en solo | Multi en ligne', 'AppJeuPc', 'AppJeuPc', 'AppJeuPc'),
